import React, {useState} from 'react';
import ToDo from './ToDo';


const heading = {
    color: 'navy',
    textAlign: 'center',
    fontSize: '40px',
    fontFamily: 'Courier New '
}


const ToDoList = ({toDoList}) => {
   return (
       <div>
           <h1 style={heading}>Task Manager</h1>
           {toDoList.map(todo => {
               return (
                   <ToDo todo={todo} />
               )
           })}
       </div>
   );
};

export default ToDoList;
